import React from 'react'

const TitleCard = () => {
    return (
        <div className='title-container'>
            <img></img>
            <div className='icon-link'>
                <span>
                    <img src="../assets/github.png" alt="" />
                    <a href='https://github.com/Nhathuy1305/BetterDay-Tool'></a>
                </span>
            </div>
        </div>
    )
}

export default TitleCard;
